import {Box, Button, ButtonText, View, Text, AvatarFallbackText, Avatar} from '@gluestack-ui/themed';



const Bagview = ()=>{

    return(
        <Box  justifyContent="center" alignItems="center" mt={"$10"} backgroundColor='red' marginTop={"0%"} height={'$full'}>
            
            <Avatar bgColor='$amber600' size="xl" borderRadius="$full" position='absolute' marginTop={"10%"} marginLeft={"20px"} >
                <AvatarFallbackText>Sandeep Srivastava</AvatarFallbackText>
            </Avatar>
      
                
                <Button position='absolute' width="305px" backgroundColor='#FFA600' color='white' marginTop={"100%"}>
                    <ButtonText >
                        Order
                    </ButtonText>

                </Button>

        </Box>

    ); 
}


export default Bagview;
